import React from "react";
import "./Home.css";

// Functional component.
function Home() {
  return (
    <div className="header">
      <h1 className="home-title"> Carolina V.</h1>
      <h2 className="home-subtitle"> Full Stack Web Developer </h2>
    </div>
  );
}

export default Home;
